import ExpenseItems from "./expenseItems";
import Card from "./card";

export default function Expenses(prob) {
  return (
    <div className="expenses">
      <ExpenseItems
        title={prob.object[0].title}
        amount={prob.object[0].amount}
        date={prob.object[0].date}
      ></ExpenseItems>
      <ExpenseItems
        title={prob.object[1].title}
        amount={prob.object[1].amount}
        date={prob.object[1].date}
      ></ExpenseItems>
      <ExpenseItems
        title={prob.object[2].title}
        amount={prob.object[2].amount}
        date={prob.object[2].date}
      ></ExpenseItems>
    </div>
  );
}
